import React, { Component } from 'react';
import { Grid, Cell } from 'react-mdl';

class Education extends Component {
  render() {
    return(
      <Grid>
        <Cell col={4}>
          <h4>Intermediate/+2</h4>
        </Cell>
        <Cell col={8}>
          <h4 style={{marginTop:'0px'}}>CBSE Board</h4>
          <h4>87.8%</h4>
        </Cell>
      </Grid>
    )
  }
}

export default Education;
